import React, { useEffect, useState } from 'react'
import axios from 'axios'
import API from "../utils/API";

function SavedPage() {

    const [books, setBooks] = useState([])
    
    useEffect(() => {
      loadBooks()
    }, [])
  
   
    function loadBooks() {
      API.getBooks()
        .then(res =>
          setBooks(res.data)
        )
        .catch(err => console.log(err));
    };
  
    
    function deleteBook(id) {
      API.deleteBook(id)
        .then(res => loadBooks())
        .catch(err => console.log(err));
    }
